const Home = lazy(() => import("../screens/Home"))
const About = lazy(() => import("../screens/About"))




function AppRoute() {
    return (
      <Suspense fallback={<div>Loading...</div>}>
        <Router>
          <Routes>
             <Route exact path="/" element={<Home />} /> 
          <Route exact path="/about" element={About} />
              {/* 
