              <Route exact path="/forget" component={Forget} /> 
             <Route exact path="/dashboard" component={Dashboard} />  */}
            {/*<Route exact path="/music" component={Music} />  */}




          </Routes>
        </Router>
      </Suspense>


    );
  }

  export default AppRoute;
